import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Users from "./User/Pages/User";

function App() {
  return (
    <>
      {/* <h1>the name </h1> */}
      <Router>
        <Route path="/User" exact>
          <Users />
        </Route>
      </Router>
    </>
  );
}

export default App;
